def match_fingerprints(template1, template2):
    # Convert hex strings to byte arrays
    bytes1 = bytes.fromhex(template1)
    bytes2 = bytes.fromhex(template2)

    # Ensure the templates are the same length
    if len(bytes1) != len(bytes2):
        return 0  # No match if lengths differ

    # Compare byte by byte
    matching_bytes = sum(1 for b1, b2 in zip(bytes1, bytes2) if b1 == b2)
    
    # Calculate similarity score (0 to 100)
    similarity = (matching_bytes / len(bytes1)) * 100

    return similarity

